import React from 'react';

function Card({ title, likes, src, onCardClick }) {
  // function handleClick() {
  //     props.onCardClick(props.card);
  //   }


  return (
    <li className="element">
      <button className="element__photo" type="button">
        <img src={src} alt="фото" className="element__image" />
      </button>
      <div className="element__info-container">
        <h2 className="element__title">{title}</h2>
        <div className="element__like-container">
          <button className="element__group" type="button"></button>
          <p className="element__counter">{likes.length}</p>
        </div>
      </div>
      <button className="element__trash " type="button"></button>
    </li>
  )

  return (
      <figure className="element" >
      <img className="element__photo" src={src} alt="" onClick={onCardClick}/>
      <button className="element__trash" type="button"></button>
      <figcaption className="element__group">
  <h2 className="element__title">{title}</h2>
        <div className="element__raiting">
          <button className="element__like" type="button"></button>
  <p className="element__count">{likes.length}</p>
        </div>
      </figcaption>
    </figure>
  )
}

export default Card;
